import React from "react";
import {Link} from "react-router-dom";
import Classes from "./Classes";
import Styles from "./Styles";


const Practice = () => {
  return(
      <>
        <h1>Practice</h1>
        <Link to="/a6/hello">
          Hello
        </Link> |
        <Link to="/a6/build">
          Build
        </Link>
        <Classes/>
      </>

  )
};

export default Practice;
